import React from 'react';
import PropTypes from 'prop-types';

class DropZone extends React.Component {
  render() {
    const content = this.props.children;

    return(
      <div className={this.props.tag}>
        {content}
      </div>
    );
  }  
}

DropZone.propTypes = {
  tag: PropTypes.string
}

export default DropZone;
